(function(){'use strict';var elementBaseUrl=document.querySelector('#swagger-ui'),url=elementBaseUrl.dataset.baseUrl,originalAuthorize,originalLogout;function addApiKeyAuthorization(key){if(key&&typeof key!=='undefined'){key=key.trim();ui.getConfigs().requestInterceptor=function(req){req.headers.Authorization='Bearer '+key;return req;};}}
function removeApiKeyAuthorization(){ui.getConfigs().requestInterceptor=function(req){delete req.headers.Authorization;return req;};}
const ui=SwaggerUIBundle({url:url,dom_id:'#swagger-ui',deepLinking:true,presets:[SwaggerUIBundle.presets.apis,SwaggerUIStandalonePreset],plugins:[SwaggerUIBundle.plugins.DownloadUrl],docExpansion:'none',layout:'StandaloneLayout'});window.ui=ui;originalAuthorize=ui.authActions.authorize;ui.authActions.authorize=function(payload){var apiKeyData=payload.api_key,keyValue=typeof apiKeyData!=='undefined'?apiKeyData.value:'';addApiKeyAuthorization(keyValue);ui.specActions.download();return originalAuthorize(payload);};originalLogout=ui.authActions.logout;ui.authActions.logout=function(payload){removeApiKeyAuthorization();ui.specActions.download();return originalLogout(payload);};})();